import React from 'react';
import { Route, Switch, Redirect } from 'react-router-dom';
import { Header } from './components/Header';

export const Routes = () => {
	return (
		<div>
			<Header />
			<Switch>
				<Route exact path="/Home" component={ Home } />
				<Route exact path="/About" component={ About } />
			</Switch>
		</div>
	);
};
